Vila Velha/ES 18-12-2022

Mais que o palco do Futebol (Sl 119:49,50)

Tu prometeste fazer ó Senhor, o Teu nome célebre;
Te engrandecendo por nós, além do que é visto;
Proclamando o teu novo nome ó Deus, que é este;
Deus... da Geração Jesus Cristo.

Lembra da palavra que nos deste ó Senhor, naquele arrebol;
Como o Brasil foi um dia o país, palco do futebol;
O Teu nome sobre nós sairá, como um grande sol;
Não há quem possa deter teu querer, grande Deus de Escol.

Fende os céus meu Senhor, derrete os montes;
Faze notório o teu nome ó Deus, entre todas nações;
Não há quem possa Senhor, ter grandeza assim;
que começa a história mostrando, qual será o seu fim.
Ajunta Senhor, todos meus oponentes, no vale da tua justiça;
Como em Deuteronômio, deixa crescerem os meus inimigos;
Ah! Como anseio ver-me rodeado, por grandes exércitos;
para que possas mostrar meu Senhor, que ainda és o mesmo.

Covas, fornalhas e vales, cadeias de ouro;
É o que tens neste mundo Senhor, dos santos perfeitos;
Mas esta tribulação momentânea, o Pai; não se compara;
A esta glória bendita ó Deus, que em nós, será revelada.

-Série: Cadeias de ouro (A VOZ CONTINUA).

